import React from "react";
import { Link, withRouter } from "react-router-dom";
import { Menu } from 'semantic-ui-react';
import './style.css';

function Navigation(props) {
  return (

          <Menu size='huge'>
            <Menu.Item header> SHIN SAITO</Menu.Item>
          </Menu>

  );
}

export default withRouter(Navigation);
